import React from "react";
import { StyleSheet } from "react-native";
import ClientHome from "./ClientHome";
import ClientProfile from "./ClientProfile";
import ClientNotifications from "./ClientRequests";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import { createStackNavigator } from "@react-navigation/stack";
import {} from "@expo/vector-icons";
import ClientBrowse from "./ClientBrowse";
import MessagesScreen from "../MessagesScreen";

const Tab = createBottomTabNavigator();


const Stack = createStackNavigator();
function CHomeStack() {
  return (
    <Stack.Navigator>
      <Stack.Screen
        name="LoginScreen"
        options={{ headerShown: false }}
        component={LoginScreen}
      />
      <Stack.Screen
        name="SignupScreen"
        options={{ headerShown: false }}
        component={SignupScreen}
      />
    </Stack.Navigator>
  );
}
function ClinetTabNavigator() {
  return (
    <Tab.Navigator>
      <Tab.Screen
        name="Home"
        initialParams={{ icon: "home" }}
        component={ClientHome}
      />
      <Tab.Screen name="Requests" component={ClientNotifications} />
      <Tab.Screen name="Profile" component={ClientProfile} />
      <Tab.Screen name="Messages" component={MessagesScreen} />
    </Tab.Navigator>
  );
}

export default ClinetTabNavigator;

const styles = StyleSheet.create({
  wrapper: {
    // position:'absolute',
    position: "relative",
    bottom: 1,
    width: 20,
    height: 50,
    backgroundColor: "red",
    alignItems: "center",
    justifyContent: "space-around",
  },
  tab: {
    flexDirection: "row",
    justifyContent: "space-between",
    backgroundColor: "red",
    // width:250,
    // borderRadius:100,
  },
});
